import React, { Component } from 'react';
import {useLocation} from 'react-router-dom';

function useQuery() {
    return new URLSearchParams(useLocation().search);
}

function Resultados(){
    let query = useQuery()
    return(
        <div>
            <h1>Se muestran los resultados para la url</h1>
            <p>query.get</p>
        </div>
    )
}

export default Resultados;
